import { useReducer, useState } from "react";
import { useNavigate } from "react-router";
import mystore from "../storeandreducer/store";


let AmbulanceProfilePg = () => {

    let flag = JSON.parse(localStorage.getItem("isLogin"));
    console.log(typeof(flag));
    console.log("**===",flag);

    // const [ambulanceuserinfo, setUserInfo] = useReducer(useReducer, init);
    
    const [uname, setUname] = useState("");
    const [password, setPassword] = useState("");
    const [role, setRole] = useState("Ambulance");

    const [drivername, setDname] = useState("");
    const [aregno, setAregno] = useState("");
    const [avehicalno, setVehicalno] = useState("");
    const [email, setEmail] = useState("");
    const [mono, setMono] = useState();
    const [website, setWebsite] = useState("");
    const [state, setState] = useState("");
    const [city, setCity] = useState("");
    const [pincode, setPincode] = useState();
    const [landmark, setLandmark] = useState("");
    const[availablestatus,setAvailablestatus]= useState();
    const [ac_status, setAcStatus] = useState();

    if(flag==true)
    {
        setUname(JSON.parse(localStorage.getItem("loginInfo")).lid.uname)
        setPassword(JSON.parse(localStorage.getItem("loginInfo")).lid.password)
        setRole(JSON.parse(localStorage.getItem("loginInfo")).lid.role)

        setDname(JSON.parse(localStorage.getItem("loginInfo")).drivername)
        setAregno(JSON.parse(localStorage.getItem("loginInfo")).aregno)
        setVehicalno( JSON.parse(localStorage.getItem("loginInfo")).avehicalno)
        setEmail(JSON.parse(localStorage.getItem("loginInfo")).email)
        setMono(JSON.parse(localStorage.getItem("loginInfo")).mono)
        setWebsite(JSON.parse(localStorage.getItem("loginInfo")).website)
        setState(JSON.parse(localStorage.getItem("loginInfo")).state)
        setCity(JSON.parse(localStorage.getItem("loginInfo")).city)
        setPincode(JSON.parse(localStorage.getItem("loginInfo")).pincode)
        setLandmark(JSON.parse(localStorage.getItem("loginInfo")).landmark)
        setAvailablestatus(JSON.parse(localStorage.getItem("loginInfo")).availablestatus)
        setAcStatus(JSON.parse(localStorage.getItem("loginInfo")).ac_status)
    }

    const navigate = useNavigate();


    // // const[flag,setFlag]=useState(false);
    // const flag=

    // mystore.subscribe( ()=> { setFlag(mystore.getState().loggedin) } );

    // const[ambusr,setAmbusr]=useState({});
    // setAmbusr( JSON.parse(localStorage.getItem("loginInfo")) )

    const logout = () => {

        localStorage.clear();

        // navigate("/");
        window.location.href="/login";


    }


    return (
        <div>
            <div >

                <nav className="navbar navbar-expand-xl bg-dark navbar-dark">
                    <ul className="navbar-nav">
                        <li className="nav-item active">
                            <a className="nav-link" href="#">Home</a>
                        </li>
                        {/* <li className="nav-item">
      <a className="nav-link disabled" href="#">Disabled</a>
    </li> */}
                        <li className="nav-item">
                            <a className="nav-link" href="#">Update Data</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Delete Account</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" onClick={logout}>Logout</a>
                        </li>

                    </ul>
                </nav>

            </div>
            {/* <div className="formInput container mt-5" style={ {display : flag? 'none':'block'} }> */}
            <div className="formInput container mt-5">
                <div>
                    <h3>Welcome {uname}</h3>

                    <table border={1}>
                        <tr>
                            <td>User Name</td>
                            <td>{uname}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Password</td>
                            <td>{password}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Driver Name</td>
                            <td>{drivername}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Ambulance Registration Number</td>
                            <td>{aregno}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Ambulance (RTO) Number</td>
                            <td>{avehicalno}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Email</td>
                            <td>{email}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Contact Number</td>
                            <td>{mono}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Working State</td>
                            <td>{state}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Working City</td>
                            <td>{city}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Working Area Pincode</td>
                            <td>{pincode}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td>Landmark</td>
                            <td>{landmark}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                        <tr>
                            <td></td>
                            <td>{availablestatus}</td>
                            <td>change</td>
                            {/* <td></td> */}
                        </tr>
                    </table>

                </div>
                <div>
                </div>
            </div>

        </div>
    )

}
export default AmbulanceProfilePg;
